    return (
        <div className={classes.loaderPage}>
            <div className={classes.loaderPage__container}>
                <div className={classes.roller}>
                </div>
                <p>Loading<span className='dot'>...</span></p>
            </div>
        </div>
    );
};

export default LoaderPage;
